import {React,useState} from "react"
import Cart from "../cart/cart";


const Header = () => {
  const [open, setOpen] = useState(false);
  const handleOpen = () => {
    setOpen(true);
    return <Cart  opened = {open} closed = {handleClose}/>
  }
  const handleClose = () => setOpen(false);
  return (
    <nav class="navbar navbar-light bg-light justify-content-between">
      <a class="navbar-brand">ReactMeal</a>
      <form class="form-inline">
        <button class="btn btn-outline-success my-2 my-sm-0" type="submit" onClick={handleOpen}><span>cart</span><span>0</span></button>
      </form>
    </nav>
  );
};
export default Header;
